        {
            name:'all',
            text:'전체보기'
        },
        {
            name:'electronics',
            text:'electronics'
        },
        {
            name:'jewelery',
            text:'jewelery'
        },
    ]
  return (
    <div>
        {categoris.map(c =>(
            <Link
            to={c.name === 'all' ? '/shop' : `/shop/${c.name}`}
            
            >
            {c.text}

            </Link>
        ))}
    </div>
  )
}
